  input: "\"TEXT\",\"F3XN\",\"C00140590\",\"January 31, 2007\t\t    Laura S.  Federal
    Elections Commission    RE:  California Republican Party           FEC ID#  C00140590
    \          Year-end (11/27/06-12/31/06)              Dear Laura S,    The committee
    is aware of CFR 300.33(C)(2).  All of the employees who are reported on Schedule
    H4 are spending less than 25% of their time on Federal Election Activity or on
    activities in connection with a federal election.     The committee is aware of
    the types of activity that must be reported on Line 30(b) as FEA.  Please note
    that none of the activity on Line 21(b) or on the H4 schedule is FEA or contains
    express advocacy.  .     All of the offsets to operating expenditures from individuals
    were for computers or cells phones that were purchased from the committee.   The
    other offsets were refunds or overpayments from vendors.    The transfers shown
    reflect variations due to timing of transfers based upon reimbursements from the
    non-federal and Levin accounts the federal account at different points in the
    70-day window provided in Reg. 10-6.7(f)(2).  No transfers were made outside the
    70-day window.      In regard to occupation and employer information requested,
    a letter is sent to those donors whose contributions exceed $200, but did not
    provide us with their employer and occupation on our initial contribution solicitation
    which sites the FEC regulation for the requested information.  The committees
    policy is to send a follow-up letter within thirty days of the original contribution
    to request this information with a pre-addressed envelop enclosed for the return
    of such information.  All such information received is reported accordingly.  If
    information is received after the reporting deadline, the committee will amend
    the appropriate monthly report.      In regards to credit card activity; a significant
    portion of the credit card charges incurred in this period were not paid till
    January 2007. Therefore credit card memo entries are significantly greater than
    payments    Keith Carlson    \""
